import React from 'react';

function Projects() {
  return (
    <div className="page-content">
      <h1>My Projects</h1>
      <p>Here is a curated list of some of the projects I’ve worked on:</p>

      <ul>
        <li><strong>Portfolio Website</strong> – A fully responsive personal website built using MERN stack.</li>
        <li><strong>Fertilizer Inventory System</strong> – Full-stack web app for managing fertilizer stocks and billing (MongoDB, Express, React, Node.js).</li>
        <li><strong>Leukemia Detection System</strong> – Machine learning-based tool for leukemia detection using HSL image processing.</li>
        <li><strong>Student Doubt Portal</strong> – React app for college freshers to ask and resolve academic doubts.</li>
      </ul>
    </div>
  );
}

export default Projects;
